CREATE TABLE MOCK_DATA_DEPT (
	ID_ INT,
	DEPT_NAME_ VARCHAR(255),
	CONSTRAINT PK_DEPT PRIMARY KEY (ID_)
);

CREATE TABLE MOCK_DATA_CITY (
	ID_ INT,
	NAME_ VARCHAR(255),
	CONSTRAINT PK_CITY PRIMARY KEY (ID_)
);


CREATE TABLE MOCK_DATA_PERSON (
	ID_ INT,
	FIRST_NAME_ VARCHAR(50),
	LAST_NAME_ VARCHAR(50),
	EMAIL_ VARCHAR(50),
	GENDER_ VARCHAR(50),
	DEPT_ INT,
	CITY_ INT,
	SALARY_ INT
);
